import React from 'react';
import './NavBar.css';

class NavBar extends React.Component {
    render() {
        return (
            <div className='navigation'> 
                <ul>
                    <li><a>Home</a></li>
                    <li><a>Menu</a></li>
                </ul>
            </div>
        )
    }
}

export default NavBar;
